import React from "react";
import styled from "styled-components";

const SloganDomain = styled.div`
  width: 26vw;
  height: 35vh;
  background: green;
  margin-left: 300px;
  margin-top: 150px;
  h1 {
    color: white;
    font-size: 3.5rem;
  }
`;

function Slogan_Domain() {
  return (
    <>
      <SloganDomain>
        <h1>
          함께하고,
          <br />
          성장하는,
          <br /> 소통하는
          <br /> Endless Creation
        </h1>
      </SloganDomain>
    </>
  );
}

export default Slogan_Domain;
